table.navbox { border: 1px solid rgb(229, 192, 118); box-shadow: 0px 0px 25px 4px rgb(229, 192, 118) inset; background-color: transparent; color: rgb(0, 0, 0); padding: 5px; font-family: "Rubik"; text-align: left; line-height: 120%; margin-right: auto; margin-left: auto; width: 97%; }
table.navbox + table.navbox { margin-top: -1px; }
.navbox-title, .navbox-abovebelow, table.navbox th { box-shadow: 0px 0px 25px 4px rgb(229, 192, 118) inset; text-align: center; color: rgb(1, 44, 87); font-family: "Rubik"; padding: 3px 1em; font-weight: normal; line-height: 1.2; letter-spacing: 3px; text-transform: uppercase; }
.navbox-group { white-space: nowrap; text-align: right; font-weight: normal; padding-left: 1em; padding-right: 1em; }
.navbox, .navbox-subgroup { background: rgb(253, 253, 253) none repeat scroll 0% 0%; }
.navbox-list { border-left: 2px solid rgb(253, 253, 253); }
.navbox-title, table.navbox th { box-shadow: 0px 0px 25px 4px rgb(229, 192, 118) inset; color: rgb(0, 0, 0); padding: 5px; font-family: "Rubik"; text-align: left; line-height: 120%; margin-left: auto; margin-right: auto; margin-top: 5px; }
.navbox-abovebelow, .navbox-group { background-color: rgb(1, 44, 87); color: white; }
.navbox-subgroup .navbox-group, .navbox-subgroup .navbox-abovebelow { background: rgb(230, 230, 255) none repeat scroll 0% 0%; }
.navbox-even { background: rgb(247, 247, 247) none repeat scroll 0% 0%; color: rgb(1, 44, 87); }
.navbox-odd { background: rgb(1, 44, 87) none repeat scroll 0% 0%; color: white; }
.navbox-list .navbox-even a:link, .navbox-even a:visited, .navbox-even a:link { color: rgb(1, 44, 87); }
.navbox-odd a:visited, .navbox-odd a:link, .navbox-list .navbox-odd a:visited { color: rgb(255, 255, 255); }
@media print {
  .navbox { display: none; }
}
